function aplicarMascara(e,a){e.addEventListener("input",()=>{let c=0,t=e.value.replace(/\D/g,"");e.value=a.replace(/#/g,()=>t[c++]||"")})}const cpf=document.getElementById("cpf");cpf&&aplicarMascara(cpf,"###.###.###-##");const telefone=document.getElementById("telefone");telefone&&aplicarMascara(telefone,"(##) #####-####");const cep=document.getElementById("cep");cep&&aplicarMascara(cep,"#####-###");